import React from "react";
import Navigation from "../stories/Navigation";

const Home: React.FC = () => {
    return (
        <>
            <Navigation />
            <h1>Welcome to My Portfolio</h1>
            <p>This is the homepage.</p>
        </>
    );
};

export default Home;
